        "text": "DAILY DAL\nMasoor dal\nd sideburns,\nin west London with a shared kitch\ned kitchen and a\nMy mum and dad got married in 1975. At the wedding, Dad wore flares, platea\nand Mum wore a red sari. They moved to a bedsit in west London wi\nsingle cupboard. Mum would cook this dal then, and she still cooks it now\nr tire of it. It's a foolproof\nthan the effort required\nThis is one of my most treasured recipes: I crave it frequently and never tires\ndish, robust and endlessly adaptable, and it yields a result far greater than th\nto make it (see photo on preceding page).\nSERVES 4\n225g red lentils\n2 tablespoons rapeseed oil\noptional: 12 peppercorns\noptional: 4 cloves\n1 onion, thinly sliced\n4 cloves of garlic, crushed\n6cm ginger, peeled and finely grated\n1/2 teaspoon chilli powder\n1/2 teaspoon ground coriander\n1/2 teaspoon ground turmeric\n1 teaspoon salt\n300g tinned plum tomatoes\nIn a sieve, rinse the lentils until the water runs clear, then drain and put into a deep lidded\nsaucepan. Add 600ml of cold water, bring to the boil over a medium to high heat, then cover with\nthe lid and simmer gently for 10 to 15 minutes without stirring, until thoroughly cooked. Like pasta.\ncooked lentils will be tender when cooked.\nMeanwhile, put the oil into another deep, lidded saucepan on a medium heat. When it's hot, add the\npeppercorns and cloves if you're using them. Stir-fry for around a minute, or until you can smell\nthem, then add the onion. Cook for 8 to 10 minutes, until golden.\nAdd the garlic and ginger and stir-fry for a further 4 minutes before adding the chilli powder,\ncoriander, turmeric and salt. Stir well, then add the tinned tomatoes. If they're whole, pour them\nout with one hand and crush them with your other hand to break them up before they hit the pain\nCover, turn the heat down and simmer for around 8 minutes.\nThe tomatoes should be looking darker and more paste-like now, with little tomato ju\nfrom them. Add the lentils using a straining spoon, then pour in any remaining wa\nboiling in, a little at a time, until you get a good consistency. For me, this is a fairly\nenough to be eaten from a plate with bread, but you may prefer yours to be more soupy:\nth little tomato juice running\nremaining water they were\nis is a fairly thick dal, thick\nFinally, cover the pan with the lid again and cook on a low heat for a further un\nneat for a further 10 minutes.\naste and adjust the salt, chilli or consistency as you see fit and serve with chape\nth chapattis (see page\n"
